function setOrderBy(self,allSites,params,mOrderBy)
{if(params['mOrderBy']==mOrderBy){if(params['order']=='desc'){params['order']='asc';}else{params['order']='desc';}}
params['mOrderBy']=mOrderBy;prepareRows(allSites,params);$('.arrow').removeClass('multisites_desc multisites_asc');if($(self).attr('class')=='evolution')
{mOrderBy='evolution';}
$('#'+mOrderBy+'  .arrow').addClass('multisites_'+params['order']);return params;}
function prepareRows(allUnsortedSites,params)
{var allSites;$("#tb").find("tr").remove();$("#next").html('');$("#prev").html('');var mOrderBy=params['mOrderBy'];allSites=orderBy(allUnsortedSites,params);if(allSites.length>params['limit'])
{allSites=limitBy(allSites,params);}
displayRows(allSites,params);showPagination(allUnsortedSites,params);params['sitesVisible']=allSites;}
function orderBy(allSites,params)
{if(params['mOrderBy']=='names')
{allSites.sort(function(a,b){if(a['name'].toLowerCase()==b['name'].toLowerCase())
{return 0;}
return(a['name'].toLowerCase()<b['name'].toLowerCase())?-1:1;});}
else if(params['mOrderBy']=='visits')
{allSites.sort(function(a,b){if(a['visits']==b['visits']){return 0;}
return(a['visits']<b['visits'])?-1:1;});}
else if(params['mOrderBy']=='pageviews')
{allSites.sort(function(a,b){if(a['pageviews']==b['pageviews']){return 0;}
return(a['pageviews']<b['pageviews'])?-1:1;});}
else if(params['mOrderBy']=='revenue')
{allSites.sort(function(a,b){var lhs=parseFloat(a['revenue'].replace(/[^0-9\.]+/g,""))||0,rhs=parseFloat(b['revenue'].replace(/[^0-9\.]+/g,""))||0;return lhs===rhs?0:((lhs<rhs)?-1:1);});}
else if(params['mOrderBy']=='revenueSummary')
{allSites.sort(function(a,b){if(a['revenueSummaryValue']==b['revenueSummaryValue']){return 0;}
return(a['revenueSummaryValue']-b['revenueSummaryValue']<=0.01)?-1:1;});}
else if(params['mOrderBy']=='pageviewsSummary')
{allSites.sort(function(a,b){if(a['pageviewsSummaryValue']==b['pageviewsSummaryValue']){return 0;}
return(a['pageviewsSummaryValue']-b['pageviewsSummaryValue']<=0.01)?-1:1;});}
else if(params['mOrderBy']=='visitsSummary')
{allSites.sort(function(a,b){if(a['visitsSummaryValue']==b['visitsSummaryValue']){return 0;}
return(a['visitsSummaryValue']-b['visitsSummaryValue']<=0.01)?-1:1;});}
if(params['order']=='desc')
{allSites.reverse();}
return allSites;}
function limitBy(allSites,params)
